import React, { Component } from "react";

class NrSports extends Component {
  render() {
      // console.log("A",this.props.nrWomenName)
    return (
                <li className="nrSportsItem">
                    <a className="nrWomenLink" href>
                      {this.props.nrWomenName}
                    </a>
                  </li>
    )
  }
}

export default NrSports;
